import HeroBanner from "../components2/Herobanner";
import Problem from "../components2/Problemsection";
import Features from "../components2/Features";
import Governmentscheme from "../components2/Governmentschemes";
import Navbar from "./navbar";
import searchicon from "../assests/search-icon.png";
export default function Home() {
    return (
        <div className="w-[100%] p-[30px] flex flex-col justify-center">
            <div className="flex justify-between items-center">
                <div>
                    <h1 className="text-[24px] sm:text-[40px] font-bold text-[white] text-center">Welcome User!,</h1>
                    <p className="text-[white] text-center">Your benefits overview</p>
                </div>
                <div className="flex justify-center items-center">
                    <button className="flex justify-center items-center">
                        <ul className="flex gap-[10px] items-center bg-[white] rounded-[8px] mt-[20px]">
                            <li className="w-[24px]"><img src={searchicon} alt="search icon" /></li>
                            <li className="text-[18px] text-center">Discover More</li>
                        </ul>
                    </button>
                </div>
            </div>
        </div>
    )
}
